      const Vector3<T> com =
          plant.CalcCenterOfMassPositionInWorld(plant_context);
      if (com[2] < 0.1) {  // Check z height of com.
        return EventStatus::Failed(plant, "System fell over.");
      }
      return EventStatus::Succeeded();
